import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';

const MyInfoPage = () => {
  const [userInfo, setUserInfo] = useState({});
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [showLogoutPopup, setShowLogoutPopup] = useState(false);
  const [showWithdrawPopup, setShowWithdrawPopup] = useState(false);

  const { userId } = useParams(); // URL 파라미터에서 userId를 추출

  const fetchAuthcheck = async () => {
    try {
      const response = await fetch(`http://localhost:3001/authcheck/${userId}`, {
        credentials: 'include',
      });
      if (response.ok) {
        const data = await response.json();
        if (data.isLoggedIn) {
          console.log('되고 있냐');
          setIsLoggedIn(true);
          fetchUserInfo();
        } else {
          setIsLoggedIn(false);
        }
      } else {
        console.error('로그인 상태 확인 오류:', response.statusText);
      }
    } catch (error) {
      console.error('API 요청 오류:', error);
    }
  };

  const fetchUserInfo = async () => {
    try {
      const response = await fetch(`http://localhost:3001/myinfo/${userId}`, {
        credentials: 'include',
      });
      if (response.ok) {
        const data = await response.json();
        if (!data.error) {
          setUserInfo(data);
        } else {
          console.log(data.error);
        }
      } else {
        console.error('사용자 정보 가져오기 오류:', response.statusText);
      }
    } catch (error) {
      console.error('API 요청 오류:', error);
    }
  };

  useEffect(() => {
    console.log(userId);
    fetchAuthcheck();
  }, [userId]);  

  const confirmLogout = () => {
    alert("로그아웃 되었습니다.");
    setShowLogoutPopup(false);
  };

  const confirmWithdraw = () => {
    alert("회원탈퇴 되었습니다.");
    setShowWithdrawPopup(false);
  };

  return (
    <div>
      <style>
        {`
          /* 스타일 코드 */
        `}
      </style>
      <h1>내 정보</h1>
      {isLoggedIn ? (
        <div>
          <table>
            <thead>
              <tr>
                <th>항목</th>
                <th>내용</th>
              </tr>
            </thead>
            <tbody>
              <tr>
                <td>이름</td>
                <td>{userInfo.name}</td>
              </tr>
              <tr>
                <td>아이디</td>
                <td>{userInfo.userId}</td>
              </tr>
              <tr>
                <td>비밀번호</td>
                <td>{userInfo.password}</td>
              </tr>
              <tr>
                <td>생년월일</td>
                <td>{userInfo.birthdate}</td>
              </tr>
              <tr>
                <td>이메일</td>
                <td>{userInfo.email}</td>
              </tr>
              <tr>
                <td>전화번호</td>
                <td>{userInfo.phone}</td>
              </tr>
            </tbody>
          </table>
          <div className="button_container">
            <button className="logout" 
            // onClick={handleLogout}
            >
              로그아웃
            </button>
            <button className="withdraw" 
            // onClick={handleWithdraw}
            >
              회원탈퇴
            </button>
          </div>
        </div>
      ) : (
        <div>
          <p>11로그인이 필요합니다.</p>
          {/* 로그인 버튼 또는 로그인 페이지로 이동하는 링크 추가 */}
        </div>
      )}

      {showLogoutPopup && (
        <div className="popup">
          <div className="popup_content">
            <div className="popup_actions">
              <button onClick={confirmLogout}>확인</button>
              <button onClick={() => setShowLogoutPopup(false)}>취소</button>
            </div>
          </div>
        </div>
      )}

      {showWithdrawPopup && (
        <div className="popup">
          <div className="popup_content">
            <div className="popup_actions">
              <button onClick={confirmWithdraw}>확인</button>
              <button onClick={() => setShowWithdrawPopup(false)}>취소</button>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default MyInfoPage;
